import React, { useState } from 'react';
import DividendForm from './components/DividendForm';
import DividendChart from './components/DividendChart';
import './styles/App.css';

function App() {
  const [page, setPage] = useState('form');
  return (
    <div className="App">
      <h1>DiviForm</h1>
      <nav style={{ marginBottom: 24, display: 'flex', gap: 16 }}>
        <button onClick={() => setPage('form')}>배당 입력</button>
        <button onClick={() => setPage('chart')}>배당 차트</button>
      </nav>
      {page === 'form' && <DividendForm />}
      {page === 'chart' && <DividendChart />}
    </div>
  );
}

export default App;

import React, { useState } from 'react';
import DividendForm from './components/DividendForm';
import DividendChart from './components/DividendChart';
import OCRUpload from './components/OCRUpload';
import TextAnalysis from './components/TextAnalysis';
import './styles/App.css';

function App() {
  const [page, setPage] = useState('form');
  return (
    <div className="App">
      <h1>DiviDash - 배당금 관리 대시보드</h1>
      <nav style={{ marginBottom: 24, display: 'flex', gap: 16, flexWrap: 'wrap' }}>
        <button onClick={() => setPage('form')}>수동 입력</button>
        <button onClick={() => setPage('ocr')}>화면 캡처 입력</button>
        <button onClick={() => setPage('text')}>텍스트 분석 입력</button>
        <button onClick={() => setPage('chart')}>배당 차트</button>
      </nav>
      {page === 'form' && <DividendForm />}
      {page === 'ocr' && <OCRUpload />}
      {page === 'text' && <TextAnalysis />}
      {page === 'chart' && <DividendChart />}
    </div>
  );
}

export default App;

import { createClient } from '@supabase/supabase-js';

const supabase = createClient(
  process.env.REACT_APP_SUPABASE_URL,
  process.env.REACT_APP_SUPABASE_ANON_KEY
);

async function insertDividend(dividendData) {
  try {
    const { error } = await supabase
      .from('dividend_entries')
      .insert([{
        account_name: dividendData.account_name,
        stock: dividendData.stock,
        dividend_amount: dividendData.dividend_amount,
        payment_date: dividendData.payment_date,
        currency: dividendData.currency || 'KRW',
        input_method: dividendData.input_method || 'manual',
        confidence_score: dividendData.confidence_score || null
      }]);

    if (error) {
      throw error;
    }

    return { success: true };
  } catch (error) {
    console.error('배당금 입력 오류:', error);
    throw new Error(`배당금 입력 실패: ${error.message}`);
  }
}

export default insertDividend;

